		"type": "string",
		"title": "Database ID",
		"description": "The ID of the database to connect to"
	},
	"collection_name": {
		"type": "string",
		"title": "Collection Name",
		"description": "The name of the collection to search in"
	}
}
*/

export default async function run({ execution_id, input, data, db, store }) {
	const database_id = data.database_id;
	const collection_name = data.collection_name;

	const database = db.database(database_id);
	const collection = database.collection(collection_name);

	const limit = 100;
	let offset = 0;
	let allObjects = [];
	let keepGoing = true;

	while (keepGoing) {
		const objects = await collection.findObjects(limit, offset);

		if (objects.length === 0) {
			keepGoing = false;
		} else {
			allObjects = allObjects.concat(objects);
			offset += objects.length;
			if (objects.length < limit) {
				keepGoing = false;
			}
		}
	}

	const filteredList = allObjects.map(storageItem => {
		return {
			labels: storageItem.value.labels,
			name: storageItem.value.name,
			voice_id: storageItem.value.voice_id,
			description: storageItem.value.description
		};
	});

	return {
		status: 'Success',
		objects: filteredList
	}
}

